●強力マグネットで固定できる７ポートＵＳＢハブ<BR>●大きなＵＳＢ機器を接続するのに便利なサイドポート装備<BR>●セルフパワー＆バスパワー両対応<BR>●パソコン未使用時もＵＳＢ機器に電源供給可能<br>●インターフェース／ＵＳＢ２．０（ＵＳＢインターフェイスに接続した場合はＵＳＢ１．１互換で動作）<BR>●最大転送速度／４８０Ｍｂｐｓ（ＵＳＢ２．０ハイスピードモード理論値）<BR>●ポート数／７ポート<BR>●供給電流／セルフパワー時：７ポート合計３５００ｍＡ以内、バスパワー時：７ポート合計３００ｍＡ以内<BR>●ケーブル長さ／付属ＵＳＢケーブル：１．５ｍ、専用ＡＣアダプタ：１．８ｍ<BR>●サイズ／２３×１４４×２３ｍｍ<BR>●質量／６６ｇ<BR>●付属品／ＵＳＢ２．０ケーブル×１、専用ＡＣアダプタ×１<br>●メーカー／エレコム<br>●型番／U2H-Z7SBK<br>●JANコード／4953103199194<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

